import React from "react";
import { Container, Line } from "./SideTrigger.jsx";

export default function SideTrigger({ handleSideBar }) {
  return (
    <Container onClick={handleSideBar}>
      <Line />
      <Line />
      <Line />
    </Container>
  );
}
